The Vishera River (Вишера) is a river in Perm Krai, Russia, a left bank tributary of the Kama River. It is 415 kilometres (258 mi) long, and its drainage basin covers 31,200 square kilometres (12,000 sq mi). The Vishera River freezes in late October or early November and stays under the ice until the end of April. There are diamond deposits in the basin of the Vishera River. The Vishera used to be part of the Cherdyn Road and is still considered one of the most picturesque rivers of the Urals. It starts on the extreme northeast of Perm Krai, near the border with the Komi Republic and Sverdlovsk Oblast. It flows on the west foothills of Ural Mountains and is a mountain river for most of its length. There are many rapids and shoals in the channel and many rocks along its banks. The Vishera Nature Reserve is along the upper reaches of the river. Main tributaries: 
*  Left: Niols, Moyva, Vels, Uls, Akchim, Yazva, Vizhaikha; 
*  Right: Lypiya, Yelva, Bolshaya Vaya, Pisanka, Govorukha, Kolva.

Veslyana River (Russian: Весляна) – is a river in Perm Krai and Komi Republic, Russia, a left tributary of the Kama River, which in turn is a tributary of the Volga River. It starts in the southeastern portion of Ust-Kulomsky District of the Komi Republic, about 7 kilometres (4 mi) from the border with Perm Krai. It flows through the Gaynsky District of Perm Krai and into the Kama River 1,193 kilometres (741 mi) from its mouth, 145 metres (476 ft) above sea level, near the rural locality of Ust-Veslyana.The river is 266 kilometres (165 mi) long, and the area of its drainage basin is 7,490 square kilometres (2,890 sq mi). Main tributaries: 
* Left: Travyanka River, Ruch River, Bolshoy Kub River, Maly Kub River, Dozovka River; 
* Right: Bolshoy Chabes River, Maly Chabes River, Vizyakha River, Chyornaya River, Utva River.

Visherka River (Russian: Вишерка) is a river in Perm Krai, Russia, a right tributary of the Kolva River. It is 75 kilometres (47 mi) long, and its drainage basin covers 3,230 square kilometres (1,250 sq mi). It flows out of lake Chusovskoe in the north of the Cherdynsky District near its border with the Komi Republic. Its mouth is upstream of the uninhabited village of Bogatyryovo, 124 kilometres (77 mi) from the mouth of the Kolva River. The most significant tributaries are: 
